import React, { Component } from 'react'
import LoginButton from './Login'

export class Header extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li>
                        <LoginButton/>
                    </li>
                </ul>

            </div>
        )
    }
}

export default Header
